import React from "react";
import ToDoListItem from "./todo-list-item";

const TodoList = ({todos}) => {
    return(
      <ul> 
        <li> <ToDoListItem label = {todos.label} important = {todos.label}/></li>
      </ul>
    );
};
export default TodoList;
